import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { FormControl, Navbar } from "react-bootstrap";
import { Container } from "react-bootstrap";
import { Form } from "react-bootstrap";
import { Button } from "react-bootstrap";
// import { logo } from "./../assets/icon/2.png";

export default function Header() {
  return (
    <>
      <Navbar collapseOnSelect expand='md' bg='light' variant='light'>
        <Container>
          <Navbar.Brand href='/'>
            {/* <img
              src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5Uq1HrL21wlv6qoqngm7k8gzyO_-Mwg_gUA&usqp=CAU'
              width='60'
              alt='Logo'
            /> */}
            <span>LOGO</span>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls='responsive-navbar-nav' />
          <Navbar.Collapse id='responsive-navbar-nav'>
            <Form inline className='pull-right'>
              <FormControl
                type='text'
                placeholder='Enter country'
                className='mr-sm-2'
              />

              <Button variant='outline-info'>Search</Button>
              <Form.Control as='select' className='selecting_language ml-4'>
                <option>EN</option>
                <option>RU</option>
                <option>FR</option>
              </Form.Control>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
}
